# 假定在(x, y)落子后，我能取得的收益
def earn(board, role, x, y, size, direction):
	earning = 0
	if role == 1:
		# 落子后黑棋（对手）取得收益的情况
		earning += evaluate(board, x, y, COLOR_BLACK, size, direction)
		# 落子后白棋（我）取得收益的情况，有先手优势额外加成
		earning += evaluate(board, x, y, COLOR_WHITE, size, direction) * DEFENSE_ARG
	else:
		# 落子后黑棋（我）取得收益的情况，有先手优势额外加成
		earning += evaluate(board, x, y, COLOR_BLACK, size, direction) * PRIORITY_BONUS
		# 落子后白棋（对手）取得收益的情况
		earning += evaluate(board, x, y, COLOR_WHITE, size, direction)
	return earning


# 假定在(x, y)落子后，评估此点的得分
def evaluate(board, x, y, color, size, direction):
	radius = 6
	score = 0
	num = 0
	board[x, y] = color
	if direction == 1 or direction == 0:  # 横向判断
		left = max(0, y - radius)
		right = min(size, y + radius)
		pattern = board[x, left:right].tolist()
		t_score = match(color, pattern)
		if t_score >= 1000:
			num += 1
		score += t_score
	if direction == 2 or direction == 0:  # 纵向判断
		top = max(0, x - radius)
		down = min(size, x + radius)
		pattern = board[top:down, y].tolist()
		t_score = match(color, pattern)
		if t_score >= 1000:
			num += 1
		score += t_score
	if direction == 3 or direction == 0:  # 左下到右上
		left = right = y
		top = down = x
		for i in range(radius):
			if left <= 0 or down >= size - 1:
				break
			left -= 1
			down += 1
		for i in range(radius):
			if right >= size or top <= -1:
				break
			right += 1
			top -= 1
		pattern = []
		while left < right and down > top:
			pattern.append(board[down, left])
			left += 1
			down -= 1
		t_score = match(color, pattern)
		if t_score >= 1000:
			num += 1
		score += t_score
	if direction == 4 or direction == 0:  # 左上到右下
		left = right = y
		top = down = x
		for i in range(radius):
			if left <= 0 or top <= 0:
				break
			left -= 1
			top -= 1
		for i in range(radius):
			if right >= size or down >= size:
				break
			right += 1
			down += 1
		pattern = []
		while left < right and top < down:
			pattern.append(board[top, left])
			left += 1
			top += 1
		t_score = match(color, pattern)
		if t_score >= 1000:
			num += 1
		score += t_score
	board[x, y] = COLOR_NONE
	if num > 1:
		score *= 2
	return score


# 在列表中找对应串进行匹配，返回匹配到的最大得分
def match(color, pattern):
	# 锁定当前落子的角色颜色为1，敌人为-1
	if color == -1:
		pattern = [-i for i in pattern]
	for i in PATTERN.keys():  # 后期考虑换为KMP加速搜索
		ri = i[::-1]  # 匹配模式逆序
		for j in range(len(pattern) - len(i) + 1):
			sub = tuple(pattern[j:j + len(i)])
			if sub == i or sub == ri:
				return PATTERN[i]
	return 0

def hash_board(board):
	string = ''
	cache = 0
	state = 0
	for i in board:
		for j in i:
			cache = cache | encoding(state, j)
			state += 1
			if state == 2:
				string += chr(cache+48)
				cache = state = 0
	return string

def encoding(state, step):
	cache = 0
	if state == 0:
		if step == 0:
			cache = cache | 0x00
		elif step == -1:
			cache = cache | 0x01
		elif step == 1:
			cache = cache | 0x02
		else:
			cache = cache | 0x03
	elif state == 1:
		if step == 0:
			cache = cache | 0x00
		elif step == -1:
			cache = cache | 0x04
		elif step == 1:
			cache = cache | 0x08
		else:
			cache = cache | 0x0C
	return cache

