		b4 = hash_board(np.rot90(board, 1))
		b5 = hash_board(np.flipud(np.rot90(board, 1)))
		b6 = hash_board(np.fliplr(np.rot90(board, 1)))
		b7 = hash_board(np.rot90(board, 2))
		b8 = hash_board(np.rot90(board, 3))
		for i in TABLE:
			tables = i.keys()
			for j in tables:
				x, y = i[j][0], i[j][1]
				if b1 == j:
					result.append(tuple((x, y)))
				# 判断棋盘状态的变式
				elif b2 == j:
					result.append(tuple((self.chessboard_size - x - 1, y)))
				elif b3 == j:
					result.append(tuple((x, self.chessboard_size - y - 1)))
				elif b4 == j:
					result.append(tuple((y, self.chessboard_size - x - 1)))
				elif b5 == j:
					result.append(tuple((y, x)))
				elif b6 == j:
					result.append(tuple((self.chessboard_size - y - 1, self.chessboard_size - x - 1)))
				elif b7 == j:
					result.append(tuple((self.chessboard_size - x - 1, self.chessboard_size - y - 1)))
				elif b8 == j:
					result.append(tuple((self.chessboard_size - y - 1, x)))
		if result:
			if RANDOM:
				random.seed()
				return result[random.randint(0, len(result)-1)]
			else:
				return result[0]
